Balupu (English: Arrogance) is a 2013 Telugu Action film directed by Gopichand Malineni. The film is produced by Prasad Vara Potluri under PVP Cinemas banner and stars Ravi Teja, Anjali and Shruti Haasan in lead roles. The film soundtrack is being composed by S. Thaman. The film released on 28 June 2013 in Telugu and Tamil.

